import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>ABELHA RAINHA</h1>
        <ul>
          <li></li>
        </ul>
      <h1>LANDING PAGE</h1>
      </header>
    </div>
  );
}

export default App;
